    def licenseKeyFormatting(self, s, k):
        """
        :type s: str
        :type k: int
        :rtype: str
        """

        s = s.replace('-', '').upper()
        n = len(s)
        if n <= k:
            return s
        return '-'.join(s[i:i+k] for i in range(0, n, k))

