class Solution(object):
    def wordBreak(self, s, wordDict):
        """
        :type s: str
        :type wordDict: List[str]
        :rtype: List[str]
        """

        # dp[i] = True if s[:i] can be segmented into a space-separated sequence of one or more dictionary words.
        # dp[i] = False otherwise.
        dp = [False] * (len(s) + 1)
        dp[0] = True

        for i in range(len(s)):
            for j in range(i + 1):
                if dp[j] and s[j:i + 1] in wordDict:
                    dp[i + 1] = True

        if dp[-1]:
            return [s[:i + 1] for i in range(len(s)) if dp[i + 1]]
        else:
            return []

