    def maxSlidingWindow(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: List[int]
        """

        if len(nums) == 0:
            return []

        if len(nums) == 1:
            return nums

        if k == 1:
            return nums

        max_list = []
        max_num = max(nums[0:k])
        max_list.append(max_num)

        for i in range(k, len(nums)):
            if nums[i] > max_num:
                max_num = nums[i]
